import numpy as np
import file_utils as utils
import cv2
import os


def attention_to_image(att, image):
    timesh = image.shape[0] / att.shape[0]
    timesw = image.shape[1] / att.shape[1]

    blocks = []

    r_h = 0
    for i in range(att.shape[0]):
        r_w = 0
        h = round(timesh + r_h)
        r_h = timesh + r_h - h
        blocks.append([])
        for j in range(att.shape[1]):
            att_val = att[i][j]

            w = round(timesw + r_w)
            r_w = timesw + r_w - w

            block = np.tile(att_val, (h, w))
            blocks[i].append(block)
    image = np.block(blocks)
    image = image * 255
    image = image.astype(np.uint8)
    zeros = np.zeros((image.shape[0], image.shape[1]), dtype=np.uint8)

    image = np.stack([zeros,image, zeros], axis=2)
    return image


def display(atts, att_shape, image):
    image = utils.read_img(image)
    cv2.imshow("image", image)
    for att in atts:
        att = np.array(att[0])
        att = att.reshape(att_shape)
        att_image = attention_to_image(att, image)
        nice = cv2.subtract(image, att_image)

        cv2.imshow("att", nice)
        cv2.waitKey(0)

def save(atts, att_shape, image, predicts, foldername):
    image = utils.read_img(image)
    pname = "".join(predicts)
    folder = os.path.join(foldername, pname)
    if not os.path.exists(folder):
        os.makedirs(folder)

    for index, att in enumerate(atts):
        att = np.array(att[0])
        att = att.reshape(att_shape)
        att_image = attention_to_image(att, image)
        nice = cv2.subtract(image, att_image)
        cv2.imwrite(os.path.join(folder, "{:0>2d}".format(index) + "_" + predicts[index] + ".png"), nice)


